    <!-- 
        图片的格式:
            jpeg(jpg)
                - 支持颜色丰富,不支持透明效果,不支持动图
                - 一般用于显示照片
            gif 
                - 支持颜色较少,支持简单透明,支持动图
                - 颜色单一的图片,动图
            png
                - 支持颜色丰富,支持复杂透明,不支持动图
                - 颜色丰富,复杂透明图片(为网页而生)
            webp
                - 谷歌新推出的,专门用来表示网页图片的格式
                - 具备了其他图片格式的所有优点,颜色丰富,支持复杂透明,支持动图,文件还小
                缺点:兼容性不好,老的浏览器ie等不支持
            
            效果一样用小的
            效果不一样用效果好的(太大也不行)

            base64
                - 将图片使用base64进行编码,这样可以将图片转换为字符,通过字符来引入图片
                - 一般都是一些需要和网页一起加载的图片才会使用base64(正常先获取html,再请求图片,有时间差)
                    一般也就背景之类的需要和网页一起加载才会用base64
                    在网页上搜索base64图片在线转换即可
        -->
